// src/components/AboutMe.jsx
import React from 'react';
import './AboutMe.css';

const AboutMe = () => {
  return (
    <section id="about" className="about-me">
      <h2>About Me</h2>
      <p>
      Hi, I'm <b>Apurva Rajput</b>, a Software Engineer with over 3 years of experience in developing custom solutions that drive efficiency and streamline workflows. With a strong background in Python, C++, CAA, EKL, and SQL, I specialize in building tools that enhance productivity and optimize operations. I am passionate about collaborating with dynamic teams to create innovative solutions, and I pride myself on my ability to adapt and thrive in fast-paced environments. Always eager to take on new challenges and make a meaningful impact with technology.
      </p>
    </section>
  );
}

export default AboutMe;
